import './App.css';
import { useEffect,useState } from 'react';
import { Button} from 'react-bootstrap';


function App() {
  const [data,setdata]=useState([])
  const [postdata,datafunc]=useState({
    username:"",
    password:""

  })

 let url="http://127.0.0.1:8000"
  console.log("hello")

  useEffect(()=>{
    fetch(url).then(res=>res.json()).then(json=>{
      console.log("AS",json)
      setdata(json)
    }).catch(e=>{
      console.log('e',e)
    })
  },[])

  // const data=()=>{


  // }
  function handle(e){
    const newdata={...data}
    newdata[e.target.id]=e.target.value
    datafunc(newdata)
    console.log()
  }

  return (
   <>
   {/* <h1>my app</h1> */}
   <center>
    {
      data.map(item=>{
        return(<div>{item.name}</div>)
      })


    }
    <form>
  <label>
    Name:
    <input onChange={(e)=>handle(e)} id="username" value={postdata.username} type="text" />
  </label>
  <br/>
  <label>
    lastname:
    <input onChange={(e)=>handle(e)} id="password" value={postdata.password} type="text" />

  </label>

  <Button  variant="contained" color="primary" className='bt grcolor'  >download</Button>
</form>

    </center>
   {/* <Button onClick={()=> handleDownloadDocument()} variant="contained" color="primary" className='bt grcolor'  >download</Button> */}
   </>
  );
}

export default App;
